import React from 'react'
import logo from './logo.svg'
import './App.css'
import Header from "./components/Header"
import Books from "./components/Books"

class App extends React.component{
  render(){
    return (
      <div className="App">
        <Header />
        <Books />
      </div>
    )
  }
}

export default App;
